"<h1 style=\" margin-top:18px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8pt; font-weight:600;\"> FAT32 Virtual Disk Management System</span></h1>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8pt;\"> </span><span style=\" font-size:8pt; font-style:italic;\">Built from Scratch, With  in Python (No External FAT Libraries)</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:40px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:8pt; font-weight:600;\">Welcome!</span><span style=\" font-size:8pt;\"> This project is a </span><span style=\" font-size:8pt; font-weight:600;\">pure Python implementation</span><span style=\" font-size:8pt;\"> of a fully functional </span><span style=\" font-size:8pt; font-weight:600;\">FAT32 disk management system</span><span style=\" font-size:8pt;\">  no shortcuts, no third-party libraries, just raw disk magic. Designed with forensic-grade precision, system-level logic, and user-level simplicity.</span></p>\n"
