"<li style=\" font-size:8pt;\" style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"> <span style=\" font-weight:600;\">Manage files</span>,  <span style=\" font-weight:600;\">Calculate slack space</span>, and  <span style=\" font-weight:600;\">Parse boot sectors</span>.</li>\n"
"<li style=\" font-size:8pt;\" style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"> <span style=\" font-weight:600;\">Encrypt files with a password</span>,  <span style=\" font-weight:600;\">Run disk health checks</span>, and  <span style=\" font-weight:600;\">Visualize stats</span>.</li></ul>\n"
